import React, { Component, ReactNode } from 'react';
import { Container } from '../Header/style';
import Logo from '../../assets/img_logo.png';

type Props = {
  imagem: ReactNode,
  children: ReactNode
}



export class ContentEtapas extends Component<Props> {
  render() {
    return (
      <div className="w-full mx-auto h-full ">
        <div className="flex justify-center px-6 my-2 h-full">
          <div className="w-full  flex">
            <div className="w-full h-auto  hidden lg:block lg:w-1/2 bg-cover rounded-l-lg">
              <img className="flex items-end imagem " src={this.props.imagem} />
            </div>
            <div className="w-full lg:w-1/1  p-5 rounded-lg lg:rounded-l-none">
              {this.props.children}
            </div>
          </div>
        </div>
      </div>
    )
  }
}
